			"id": "1.1.5.1",
			"text": "(a) Events of Default.",
			"textcontent": ["(i) Failure to Pay or Deliver. Failure by the party to make, when due, any payment under this Agreement or delivery under Section 2(a)(i) or 2(e) required to be made by it if such failure is not remedied on or before the third Local Business Day after notice of such failure is given to the party;", "(ii) Breach ofA greement. Failure by the party to comply with or perform any agreement or obligation (other than an obligation to make any payment under this Agreement or delivery under Section 2(a)(i) or 2(e) or to give notice of a Termination Event or any agreement or obligation under Section 4(a)(i), 4(a)(iii) or 4(d)) to be complied with or performed by the party in accordance with this Agreement if such failure is not remedied on or before the thirtieth day after notice of such failure is given to the party;", "(iii) Credit Support Default. (1) Failure by the party or any Credit Support Provider of such party to comply with or perform any agreement or obligation to be complied with or performed by it in accordance with any Credit Support Document if such failure is continuing after any applicable grace period has elapsed;", "(iv) Misrepresentation. A representation (other than a representation under Section 3(e) or (f)) made or repeated or deemed to have been made or repeated by the party or any Credit Support Provider of such party in this Agreement or any Credit Support Document proves to have been incorrect or misleading in any material respect when made or repeated or deemed to have been made or repeated;", "(v) Default under Speci fied Transaction. The party, any Credit Support Provider of such party or any applicable Specified Entity of such party (1) defaults under a Specified Transaction and, after giving effect to any applicable notice requirement or grace period, there occurs a liquidation of, an acceleration of obligations under, or an early termination of, that Specified Transaction, (2) defaults, after giving effect to any applicable notice requirement or grace period, in making any payment or delivery due on the last payment, delivery or exchange date of, or any payment on early termination of, a Specified Transaction (or such default continues for at least three Local Business Days if there is no applicable notice requirement or grace period) or (3) disaffirms, disclaims, repudiates or rejects, in whole or in part, a Specified Transaction (or such action is taken by any person or entity appointed or empowered to operate it or act on its behalf);", "(vi) Cross Default. If \"Cross Default\" is specified in the Schedule as applying to the party, the occurrence or existence of (1) a default, event of default or other similar condition or event (however described) in respect of such party, any Credit Support Provider of such party or any applicable Specified Entity of such party under one or more agreements or instruments relating to Specified Indebtedness of any of them (individually or collectively) in an aggregate amount of not less than the applicable Threshold Amount (as specified in the Schedule) which has resulted in such Specified Indebtedness becoming, or becoming capable at such time of being declared, due and payable under such agreements or instruments, before it would otherwise have been due and payable or (2) a default by such party, such Credit Support Provider or such Specified Entity (individually or collectively) in making one or more payments on the due date thereof in an aggregate amount of not less than the applicable Threshold Amount under such agreements or instruments (after giving effect to any applicable notice requirement or grace period);", "(vii) Bankruptcy. The party, any Credit Support Provider of such party or any applicable Specified Entity of such party:-", "(viii) Merger Without Assumption. The party or any Credit Support Provider of such party consolidates or amalgamates with, or merges with or into, or transfers all or substantially all its assets to, another entity and, at the time of such consolidation, amalgamation, merger or transfer:-"],
