			"text": "(b) Termination Events.",
			"textcontent": ["(i) Illegality. Due to the adoption of, or any change in, any applicable law after the date on which a Transaction is entered into, or due to the promulgation of, or any change in, the interpretation by any court, tribunal or regulatory authority with competent jurisdiction of any applicable law after such date, it becomes unlawful (other than as a result of a breach by the party of Section 4(b)) for such party (which will be the Affected Party):-", "(ii) Tax Event. Due to (x) any action taken by a taxing authority, or brought in a court of competent jurisdiction, on or after the date on which a Transaction is entered into (regardless of whether such action is taken or brought with respect to a party to this Agreement) or (y) a Change in Tax Law, the party (which will be the Affected Party) will, or there is a substantial likelihood that it will, on the next succeeding Scheduled Payment Date (I) be required to pay to the other party an additional amount in respect of an Indemnifiable Tax under Section 2(d)(i)(4) (except in respect of interest under Section 2(e), 6(d)(ii) or 6(e)) or (2) receive a payment from which an amount is required to be deducted or withheld for or on account of a Tax (except in respect of interest under Section 2(e), 6(d)(ii) or 6(e)) and no additional amount is required to be paid in respect of such Tax under Section 2(d)(i)(4) (other than by reason of Section 2(d)(i)(4)(A) or (B));", "(iii) Tax Event U pon Merger. The party (the \"Burdened Party\") on the next succeeding Scheduled Payment Date will either (1) be required to pay an additional amount in respect of an Indemnifiable Tax under Section 2(d)(i)(4) (except in respect of interest under Section 2(e), 6(d)(ii) or 6(e)) or (2) receive a payment from which an amount has been deducted or withheld for or on account of any Indernnifiable Tax in respect of which the other party is not required to pay an additional amount (other than by reason of Section 2(d)(i)(4)(A) or (B)), in either case as a result of a party consolidating or amalgamating with, or merging with or into, or transferring all or substantially all its assets to, another entity (which will be the Affected Party) where such action does not constitute an event described in Section 5(a)(viii);", "(iv) Credit Event Upon Merger. If \"Credit Event Upon Merger\" is specified in the Schedule as applying to the party, such party (\"X\"), any Credit Support Provider of X or any applicable Specified Entity of X consolidates or amalgamates with, or merges with or into, or transfers all or substantially all its assets to, another entity and such action does not constitute an event described in Section 5(a)(viii) but the creditworthiness of the resulting, surviving or transferee entity is materially weaker than that of X, such Credit Support Provider or such Specified Entity, as the case may be, immediately prior to such action (and, in such event, X or its successor or transferee, as appropriate, will be the Affected Party); or", "(v) Additional Termination Event. If any \"Additional Termination Event\" is specified in the Schedule or any Confirmation as applying, the occurrence of such event (and, in such event, the Affected Party or Affected Parties shall be as specified for such Additional Termination Event in the Schedule or such Confirmation)."],
