                            "text": "(c) Use of Posted Collateral.",
                            "textcontent": " Unless otherwise specified in Paragraph 13 and without limiting the rights and obligations of the parties under Paragraphs 3, 4(d)(ii), 5, 6(d) and 8, if the Secured Party is not a Defaulting Party or an Affected Party with respect to a Specified Condition and no Early Termination Date has occurred or been designated as the result of an Event of Default or Specified Condition with respect to the Secured Party, then the Secured Party will, notwithstanding Section 9-207 of the New York Uniform Commercial Code, have the right to:",
